import {BrowserRouter, Routes, Route} from "react-router-dom";
import UserList from "./components/UserList";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<UserList/>}/>
        <Route path="/" element={<UserList/>}/>
      </Routes>
      <UserList/>
    </BrowserRouter>
  );
}

export default App;
